//via.placeholder.com/400x300?text=Maxi+Zoo",services:["Free Nutritional Consultations","Puppy Starter Packages","Senior Dog Nutrition","Weight Management Programs","Loyalty Program","Click & Collect"],brands:["Select Gold","Taste of the Wild","Canagan","Barking Heads","Lily's Kitchen","Wolf of Wilderness"],hours:"Monday-Friday: 9:00am-9:00pm, Saturday: 9:00am-7:00pm, Sunday: 10:00am-6:00pm"},{id:3,name:"Petmania Limerick",address:"Unit 5, Parkway Retail Park, Dublin Road, Limerick",county:"Limerick",phone:"061 308 580",email:"limerick@petmania.ie",website:"https://www.petmania.ie",rating:4.9,reviewCount:732,description:"Petmania Limerick is a premier destination for dog nutrition in the Mid-West region. Their in-store nutrition experts offer personalized feeding plans based on your dog's breed, age, activity level, and health conditions. The store features a dedicated nutrition center with sampling stations where dogs can try different premium foods before purchase. Petmania's Nutri-Centre program provides ongoing support and dietary monitoring to ensure optimal health for your canine companion.",image:"https://via.placeholder.com/400x300?text=Petmania",services:["Personalized Feeding Plans","Food Sampling Stations","Nutri-Centre Program","Health Condition Specific Diets","Puppy Development Nutrition","Subscription Delivery"],brands:["Canagan","Acana","Orijen","Natures Menu","Eden Holistic","Carnilove"],hours:"Monday-Wednesday: 9:30am-6:00pm, Thursday-Friday: 9:30am-8:00pm, Saturday: 9:30am-6:00pm, Sunday: 12:00pm-6:00pm"},{id:4,name:"Fetch Your Pet Needs",address:"Unit 3, Kinsale Road Commercial Centre, Cork",county:"Cork",phone:"021 431 4150",email:"info@fetchyourpetneeds.ie",website:"https://www.fetchyourpetneeds.ie",rating:4.6,reviewCount:495,description:"Fetch Your Pet Needs is a family-run business established in 2016, specializing in high-quality pet nutrition with a strong focus on natural and biologically appropriate diets for dogs. Their Cork store offers